import './App.css';
import { useState } from 'react'

const App = () => {

  const [ name, setName ] = useState('john')

  return (
    <div>
      <h1>Your name is:</h1>
      <span className='text'>{ name }</span>
      <button onClick={setName('Ben')} >Test</button>
    </div>
  )
}

export default App
